import React from "react";
import './navigation.css';


const NavigationMenu = () => {
    return(
        <div className="ContainerLuar1">
        <div className="NavigationCon">

            <div className="LogoContainer">
            <div className="Logo">LOGO</div>
            </div>

            <div className="MenuContainer">

                <div className="MenuBtn">
                    <div className="LogoMenu">logo</div>
                    <div className="NamaMenu">Jadwal</div>
                </div>

                <div className="MenuBtn">
                    <div className="LogoMenu">logo</div>
                    <div className="NamaMenu">Data Pasien</div>
                </div>

                <div className="MenuBtn">
                    <div className="LogoMenu">logo</div>
                    <div className="NamaMenu">History</div>
                </div>
            </div>

            <div className="footer">
                <div className="FotoProfile">Foto</div>
                <div className="Nama">Budi</div>
            </div>
            </div>
        </div>
    );
};



const NavigationContainer = () =>{

    return(
        <div className="NavContainer">
            <NavigationMenu />


        </div>


    );



};


export default NavigationContainer;
